// Import all clothing images
// Each import represents a different clothing item image from our assets
import coat from './Frame 1597881853.png';
import warmPuffer from './Frame 1597881854.png';
import bomber from './Frame 1597881855.png';
import bikerJacket from './Frame 1597881856.png';
import denimJacket from './Frame 1597881857.png';
import blazer from './Frame 1597881858.png';
import printed from './Frame 1597881859.png';
import basicTees from './Frame 1597881860.png';
import baseballTee from './Frame 1597881861.png';
import crewNeck from './Frame 1597881862.png';

// Export all images as a single object
// This makes it easier to import and use images in other components
export const images = {
  coat,          // Black coat image
  warmPuffer,    // Gray puffer jacket image
  bomber,        // Orange bomber jacket image
  bikerJacket,   // Brown leather biker jacket image
  denimJacket,   // Light blue denim jacket image
  blazer,        // Navy blue blazer image
  printed,       // Printed/checked shirt image
  basicTees,     // Basic black t-shirt image
  baseballTee,   // Baseball style t-shirt image
  crewNeck      // Red crew neck sweatshirt image
};
